		rootColor = '#cecece';
		backRootColor = '#afafaf';

		switch(tooth.status) {
			case 'INCLUDED':
				tag = <span className={css(styles.balloon)} style={ {background: '#86bfb5'} }> INC </span>;
				break;
			case 'AGENESIS':
				tag = <span className={css(styles.balloon)} style={ {background: '#7a6d89'} }> AGE </span>;
				break;
			case 'EXODONTIA':
				tag = <span className={css(styles.balloon)} style={ {background: '#d8c74c'} }> EXO </span>;
				break;
			case 'MISSING':
				tag = <span className={css(styles.balloon)} style={ {background: '#9dc458'} }> AUS </span>;
				break;
			case 'LOST':
				tag = <span className={css(styles.balloon)} style={ {background: '#e2af5d'} }> PER </span>;
				break;
			default:
				break;
		}
		
		var listTop = ['55', '54', '53', '52', '51', '61', '62', '63', '64', '65', '18', '17', '16', '15', '14', '13', '12', '11', '21', '22', '23', '24', '25', '26', '27', '28'];
